urant rental\"]\r\n   </div>\r\n</div>\r\n\r\n<div class=\"input-ctn\">\r\n    <label class=\"msg\"> Comments or informations\r\n    [textarea your-message] </label>\r\n</div>\r\n\r\n<div class=\"submit-ctn\">\r\n    [submit \"Send\"]\r\n</div>\n1\nmaximus \"[your-subject]\"\n[your-name] <wordpress@maximus.test>\nremi.clermont@ctrlweb.ca\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on maximus (https://maximus.test)\nReply-To: [your-email]\n\n\n\n\nmaximus \"[your-subject]\"\nmaximus <wordpress@maximus.test>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on maximus (https://maximus.test)\nReply-To: remi.clermont@ctrlweb.ca\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.','Booking','','publish','closed','closed','','contact-form-1','','','2018-11-20 17:38:19','2018-11-20 22:38:19','',0,'https://maximus.test/?post_type=wpcf7_contact_form&#038;p=5',0,'wpcf7_contact_form','',0),(6,1,'2018-11-20